#
# TABLE STRUCTURE FOR: HUESPED
#

DROP TABLE IF EXISTS `HUESPED`;

CREATE TABLE `HUESPED` (
  `NUM_ID` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NACIONALIDAD` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_TARJETA` varchar(19) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `FAMILIA_NUMEROSA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ESTADO_CIVIL` enum('Soltero','Casado','Viúdo','Divorciado') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `SITUACION_LABORAL` enum('Empresario','Autónomo','Asalariado','Cooperativista','En paro','Jubilado') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `MEDIO_TRANSPORTE` enum('Coche','Avión','Tren','Moto','Bus','Camión') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `COMO_CONOCISTE` enum('Internet','Publicidad','Conocidos','Otros') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `TRAE_MASCOTA` enum('Sí','No') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `PAIS_RESIDENCIA` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`NUM_ID`),
  UNIQUE KEY `ID_CLIENTE` (`ID_CLIENTE`),
  UNIQUE KEY `NUM_TARJETA` (`NUM_TARJETA`),
  CONSTRAINT `HUESPED_ibfk_1` FOREIGN KEY (`ID_CLIENTE`) REFERENCES `CLIENTE` (`ID_CLIENTE`) ON DELETE SET NULL,
  CONSTRAINT `HUESPED_ibfk_2` FOREIGN KEY (`NUM_ID`) REFERENCES `PERSONA` (`NUM_ID`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



